        name: "Adetomiwa",
        tweet: "My people how una dey"
      }, {
        name: "Adedayo",
        tweet: "I need alcohol pls"
      }, {
        name: "Aderonke",
        tweet: "I am madam HR"
      }
    ])
    return (
        <section>
            {tweets.map(x => {<h1>{x}</h1>})}
        </section>
    )
}
